import React from 'react';
import { Navigate } from 'react-router';

function Logo() {
    const handleClick = () => {
        Navigate(`/`);

    }
    return (
        <a
            className="navbar-brand"
            href="index.html"
            style={{ color: "#1196cf" }}
            onClick={() => handleClick()}
        >
            <b>DealBook</b>.xyz
        </a>
    )
}

export default Logo
